text=""
#probably could do this a lot easier with regex
def main():
	pos = 0
	result = ""
	for char in text:
		if (char.islower() and pos > 3 and pos < len(text)-4):
			found = True
			before = text[pos-3:pos]
			beforeA = text[pos-4]
			after = text[pos+1:pos+4]
			afterA = text[pos+4]
			guards = before+after
			for char in guards:
				if not char.isupper():
					found = False
			if (beforeA.isupper() or afterA.isupper()):
				found = False
			if(found):
				result+=text[pos-3:pos+4]+"\n"
				pos+=1
			else:
				pos+=1
		else:
			pos+=1
	return result

print("%s") % main()

